import React from 'react';
import './App.css';

function App() {
    return <div className="App">
        <ToDoList/>
    </div>
}

function ToDoList() {
    return <div>
        <h3>What to learn</h3>
        <div>
            <input/>
            <button></button>
        </div>
        <ul>
            <li><input type="checkbox" checked={true}/><span>CSS</span></li>
        </ul>
    </div>
}

export default App;
